import React, {useState} from 'react'

const TreeItem = ({item}) => <div style={{paddingLeft: '20px'}}>
    <h4>{item.title}</h4>
    {item.items && item.state == 'open' ? <Tree items={item.items}/> : null}
</div>

const Tree = ({items}) => <div>
    {items.map((i, key) => <TreeItem key={key} item={i}/>)}    
</div>


export default Tree;
